import {Route, Routes } from "react-router-dom";
import LoginPage from "../page/login";

const RouterPage = () => {
  return (

      <Routes>
        <Route path="/admin/login" element={<LoginPage></LoginPage>}></Route>
      </Routes>

  );
};

export default RouterPage;
